import React from 'react'
import { Filter } from './Filter'
import { MovieCard } from "./MovieCard"

export const MovieList = ({movies}) => {

    return (
        <div>
            <Filter/>
        <div className="movie-list">
            {movies.map((el) => <MovieCard movie={el} />)}
            </div>
            </div>
    )
}
